import React, { useEffect } from 'react'
import { useState } from 'react'

const Clients = () => {
  const[clients, setClients] = useState()
  useEffect(() => {
    fetch('/clients')
      .then(r => r.json())
    .then(data => setClients(data))
  })
  return (
    <div>
      clients go here
    </div>
  )
}

export default Clients
